import "../Styles/Filtering.css"
function Filtering() {
    return(
        <div className="panel">
            <div className="panel-item">
                <input type="range" name="pricerange" id="pricerange" />
                <label htmlFor="pricerange"><i class="fa-solid fa-tags"></i></label>
            </div>
            <div className="panel-item">
                <button type="button">Popularity increasing</button>
                <button type="button">Popularity decreasing</button>
            </div>
        </div>
    );
}
export default Filtering;
